import './App.css';

function App() {
  const title = "Historicast"
  const tagLine = "See forcasts from the past"
  return (
    <div className="App">
      <div className="content">
        <h1>{ title }</h1>
        <p>{ tagLine }</p>
      </div>
    </div>
  );
}

export default App;
